import React from 'react'
import ReactDOM from 'react-dom'

const App = () => {
    const feedback = {
        title: 'Give feedback',
        votes: {
            good: 0,
            neutral: 0,
            bad: 0
        }
    }

    return (
        <div>
            <Header {...feedback}/>
            <Buttons/>

        </div>
    )
}

const Header = (props) => {

    console.log(props)
    return (

        <h1></h1>
    )
}

const Buttons = (props) => {
    return (
        <>
            <button>Vote up</button>
            <button>Vote neutral</button>
            <button>Vote down</button>
        </>
    )
}
